      {username:'Turan', password:'q1w2e3'}
    ]
  });


  return (
    <div className="App">
      <header className="App-header">
        <p>Assignment-1</p>
      </header>
      <body>
        <UserOutput username={userState.users[0].username} password={userState.users[0].password}/>
        <UserOutput username={userState.users[1].username} password={userState.users[1].password}/>
      </body>
    </div>
  );
}

export default App;
